function Menu(){
    return (
    <p>
    Menu:
    <ul>
    <li><a href="/profile">Profile</a></li>
    <li><a href="/proyek">Proyek</a>
    <ul>
    <li><a href="/proyek/web-app">Web App</a></li>
    <li><a href="/proyek/mobile-app">Mobile App</a></li>
    </ul>
    </li>
    </ul>
    </p>
    );
   }
   const Profile = () =>(
    <div>
    <h1>Jaya Olshop</h1>
    <p>Jaya Olshop Menyediakan Semua kebutuhan yang anda perlukan, jika ada suatu barang yang anda cari belum tersedia pada halaman web kami, silahkan hubungi admin dibawah ini. </p>
    <hr />
    <Menu />
    </div>
   )
   export default Profile;
